controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    if (Mouse.mouseSprite().overlapsWith(AboutThisMac)) {
        if (AboutThisMacDrag == 1) {
            AboutThisMacDrag = 0
            sprites.destroy(AboutThisMac)
        }
    }
    if (Mouse.mouseSprite().overlapsWith(SystemSettings)) {
        if (SystemSettingDrag == 1) {
            SystemSettingDrag = 0
            sprites.destroy(SystemSettings)
            color.startFadeFromCurrent(color.originalPalette, 1000)
        }
    }
    if (Mouse.mouseSprite().overlapsWith(AppStore)) {
        if (AppStoreDrag == 1) {
            AppStoreDrag = 0
            sprites.destroy(AppStore)
        }
    }
    if (Mouse.mouseSprite().overlapsWith(Finder)) {
        if (FinderDrag == 1) {
            FinderDrag = 0
            sprites.destroy(Finder)
        }
    }
    if (Mouse.mouseSprite().overlapsWith(Safari)) {
        if (SafariDrag == 1) {
            SafariDrag = 0
            sprites.destroy(Safari)
        }
    }
})
