function DragAbility () {
    if (controller.A.isPressed()) {
        if (Mouse.mouseSprite().overlapsWith(AboutThisMac)) {
            if (AboutThisMacDrag == 1) {
                AboutThisMac.follow(Mouse.mouseSprite(), 1000)
            }
        } else if (Mouse.mouseSprite().overlapsWith(SystemSettings)) {
            if (SystemSettingDrag == 1) {
                SystemSettings.follow(Mouse.mouseSprite(), 1000)
            }
        } else if (Mouse.mouseSprite().overlapsWith(AppStore)) {
            if (AppStoreDrag == 1) {
                AppStore.follow(Mouse.mouseSprite(), 1000)
            }
        } else if (Mouse.mouseSprite().overlapsWith(Finder)) {
            if (FinderDrag == 1) {
                Finder.follow(Mouse.mouseSprite(), 1000)
            }
        } else if (Mouse.mouseSprite().overlapsWith(Safari)) {
            Safari.follow(Mouse.mouseSprite(), 1000)
        } else {
        	
        }
    }
}
